import React from "react";
import { Row, Col, Card } from "react-materialize";

class Nav extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <Row>
        <Col m={6} s={12}>
          <Card
            className="blue-grey darken-1"
            textClassName="white-text"
            title="Card title"
            actions={[<a />, <a />]}
          >
            I am a very simple card.
          </Card>
        </Col>
      </Row>
    );
  }
}

export default Header;
